from typing import List


class Solution:
    def groupStrings(self, words: List[str]) -> List[int]:
        words = [set(w) for w in words]

        def can_connect(i, j):
            isubj = words[i] - words[j]
            jsubi = words[j] - words[i]
            if len(words[i]) == len(words[j]) and len(isubj) <=1:
                return True
            if len(words[i]) - len(words[j]) == 1 and len(isubj) == 1:
                return True
            if len(words[j]) - len(words[i]) == 1 and len(jsubi) == 1:
                return True
            return False

        root = {}
        # for i in range(len(words)):
        #     root[i]=i

        def find(x):
            if x not in root:
                root[x] = x
                return root[x]
            else:
                path = []
                node = x
                while root[node] != node:
                    path.append(node)
                    node = root[node]
                res = node
                for node in path:
                    root[node] = res
                return res

        def connect(x, y):
            root[find(x)] = find(y)



        for i in range(len(words)):
            for j in range(i + 1, len(words)):
                if can_connect(i, j):
                    connect(i, j)

        groups = {}
        for i in range(len(words)):
            x = find(i)
            groups.setdefault(x, [])
            groups[x].append(i)
        return [len(groups), max([len(arr) for arr in groups.values()])]


